import React from 'react'

const Register = () => {
  return (
    <div>
        
        name: <input type="text" name='name' /><br />
        phone: <input type="text" name='phone' /><br />
        email: <input type="text" name='e' /><br />
        name: <input type="text" name='name' /><br />
    </div>
  )
}

export default Register
